-- Serveur : MySQL Server 
-- Auteur : Guy Verghote 
-- Date : 23/02/2021
-- -------------------------------------------

use gsb;

drop table if exists ville;

create table ville (
	idDepartement varchar(2),
	idCommune int,
	nom varchar(75),
	codePostal varchar(5),
	PRIMARY KEY (idDepartement,idCommune)
);
































































































		
